En Colombia, "antojarse" se utiliza de manera similar a otros países hispanohablantes, refiriéndose a sentir un deseo repentino y fuerte por algo, generalmente comida. Aunque es una palabra común en el idioma español, su uso puede considerarse parte del habla cotidiana y, por lo tanto, puede adquirir connotaciones idiomáticas propias de la cultura colombiana. Por esta razón, se clasifica como un modismo colombiano en este contexto.

